import React from 'react'
function Movie({akalista}) {
  return (
       <div> <div key={akalista.id}>
      <h1>{akalista.name}</h1>
      <p>Rating: {akalista.rating}</p>
      <p>Description: {akalista.description}</p>
    </div></div>
  )
}

export default Movie
